- name: ✈️ 选择代理
  proxies:
  - ⚡️ 自动优选
  - ⚖️ 负载均衡-同一url同一节点
  - ⚖️ 负载均衡-同一url不同节点
  - 👆 手动选择
  - DIRECT
  type: select
- expected-status: 204
  include-all: true
  include-all-proxies: true
  interval: 120
  lazy: true
  max-failed-times: 2
  name: ⚡️ 自动优选
  timeout: 3000
  tolerance: 10
  type: url-test
  url: https://www.google.com/generate_204
- expected-status: 204
  include-all: true
  include-all-proxies: true
  interval: 120
  lazy: true
  max-failed-times: 2
  name: ⚖️ 负载均衡-同一url同一节点
  strategy: consistent-hashing
  timeout: 3000
  type: load-balance
  url: https://www.google.com/generate_204
- expected-status: 204
  include-all: true
  include-all-proxies: true
  interval: 120
  lazy: true
  max-failed-times: 2
  name: ⚖️ 负载均衡-同一url不同节点
  strategy: round-robin
  timeout: 3000
  type: load-balance
  url: https://www.google.com/generate_204
- expected-status: 204
  include-all: true
  include-all-proxies: true
  interval: 120
  lazy: true
  max-failed-times: 2
  name: 👆 手动选择
  timeout: 3000
  type: select
  url: https://www.google.com/generate_204
